import './App.css';
// import { AboutMe } from './pages/AboutMe';
import { Homepage } from './pages/Homepage';

function App() {
  return (
    <Router>
      <Routes>
        <Route>
          <Route path='/' element={<Homepage />} />
          <Route path='/' element={<AboutM />} />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
